import React, { useState, useCallback } from 'react';
import { Form, List, Button, Checkbox} from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 70%;
    margin : 0 auto;
    margin-top: 20px;
`;

const CustomBtn = styled(Button)`
    width: auto;
    float: right;
`;
const CustomItem = styled(List.Item)`
    margin: 0;
    text-align: center;
`;

const data = [{
    id: 1,
    content: '살 70Kg 만들기'
}, {
    id: 2,
    content: '돈 500만원 모으기'
}, {
    id: 3,
    content: '돈 500만원 모으기'
}];

const EditUser = () => { 
    return (
        <Form>
            <CenterDiv>
                <List
                style={{overflow: 'hidden'}}
                size="small"
                bordered
                dataSource={data}
                renderItem={item => <CustomItem>{item.content}</CustomItem>}
                />
            </CenterDiv>
        </Form>
    );
}

export default EditUser;
